import React from "react";
//import * as t_f from '@tensorflow/tfjs-node'
import * as tf from '@tensorflow/tfjs';
import LineGraph from 'C:/NewReactResume/resm/src/Components/ChartJs/Charts.js'
import Grid from '@material-ui/core/Grid'
import {makeStyles} from '@material-ui/core/styles'
import CardHeader from '@material-ui/core/CardHeader';
import Card from '@material-ui/core/Card'
import CardContent from '@material-ui/core/CardContent';
import aPic from 'C:/NewReactResume/resm/src/assets/img/indicator.gif'
import Play from '../../Components/PlayGround/PlayGround.js'
//const model = tf.sequential();
//this is how you export a variable lmao
export var theindata = {};// = {data:state.x}

//console.log(theindata)
export var thelabels;// = {labels:state.y}
const model = tf.sequential({
    layers: [
      tf.layers.dense({inputShape: [5], units: 5, activation: 'sigmoid'}),
      tf.layers.dense({units:15, activation:'sigmoid'}),
      tf.layers.dense({units:10, activation:'sigmoid'}),
      tf.layers.dense({units: 5, activation: 'sigmoid'}),
    ]
   });
var prediction_;
export var data_;
var labels;
var vlafs;
var dummy;
var dummy1;

const useStyles = makeStyles(theme => ({
    root: {
      marginTop:theme.spacing(10),
    },
    media: {
      height: 0,
      paddingTop: '56.25%', // 16:9
    },
    expand: {
      transform: 'rotate(0deg)',
      marginLeft: 'auto',
      transition: theme.transitions.create('transform', {
        duration: theme.transitions.duration.shortest,
      }),
    },
    expandOpen: {
      transform: 'rotate(180deg)',
    },
    avatar: {
      backgroundColor: '#FFF',
    },
  }));

  model.compile({
    optimizer: 'sgd',
    learningrate: 0.003,
    dropout: 0.002,
    loss: 'categoricalCrossentropy',
    metrics: ['accuracy']
  });
export var state;

export default class AnotherMl extends React.Component{
    
    constructor(props) {

        super(props);
        
      }
        state = {
            isTfReady:false,
            trained:false,
            isitraining: false,
            x : null, 
            y : null,
            loss: null,
            measure: null,
            measure1:null,
            datasets : null, 
            counter : 0,
            prediction:null
        }  
    
    async componentDidMount() {
        // Wait for tf to be ready.
        await tf.ready();
        // Signal to the app that tensorflow.js can now be used.
        this.setState({isTfReady: true})
        this.setState({trained: false})
        //this.setState({counter:0+1})
        //this.train()
        //this.setState({training:true})
        //const source = { uri: response.uri }
        await this.trainTheModel()
    }
    async trainTheModel(){

        // Generate dummy data.
        data_ = tf.randomNormal([100, 5]);
        labels = tf.randomUniform([100, 5]);
        this.setState({isitraining:true})
        //console.log(data.print())
        //console.log(labels.print())
        //this.setState({x:data.array()})
        //this.setState({y:labels})
        //data_.array().then(array=>console.log(array))
        let counter = 0;
        
        //vlafs = await data.data()//.then(array => console.log(array))
        //console.log(vlafs)
        //console.log(vlafs)
        //console.log(JSON.stringify(this.state.x))

        function onBatchEnd(batch, logs) {
            
            console.log(`Accuracy: ${logs.acc}`,  `loss: ${logs.loss}`,  `epoch: ${counter}`);
            
            //console.log(typeof(logs.loss))
            //this.setState({loss : logs.loss})
            //let hi = async () => {
                
                
            //}
            
            //  hi()
            counter += 1;
            //isTraining()
            //)
        }

        function updateChart(logs) {
            
            //console.log('Accuracy', logs.acc, 'loss', logs.loss, 'epoch', counter);
        }

        // Train for 5 epochs with batch size of 32.
        model.fit(data_, labels, {
        epochs: 1, //add sliders to these options.
        batchSize: 10,
        callbacks: {onBatchEnd}
        }).then(info => {
            //this.setState({isitraining:false})
            //console.log('Final accuracy', info.history.acc);
            this.setState({isitraining:false})
            this.setState({trained:true})
            this.thePrediction()
            //model.summary()
        });

    }
    

    async thePrediction(){

        if(this.state.trained)
            {
                prediction_ = await model.predict(tf.randomNormal([3, 5]));
                //console.log(prediction_?"yes":"no")
                //console.log(prediction_.print())
                this.setState({prediction: prediction_.toString(prediction_.print())})
                

                //this.setState({prediction: prediction_.print()})
                //console.log(prediction_.print())
            }
        this.randomm()
    }

    async randomm(){

        dummy = await model.getWeights().values().next().value //valid call
        //dummy1 = await model.loss.toString()
        dummy1 = JSON.stringify(model.summary())
        //Document.toString(dummy1)
        
        //dummy = await model.trainableWeights.toString() not iter
        //model.g
        //console.log("cokooooooo",dummy)
        //this.setState({measure1: dummy1})

        
        //console.log(theindata["data"])
        
        //console.log(this.state.measure1)
        //document.writeln(this.state.measure1)
    }
    
    render()
        {
            const { isTfReady, trained, isitraining, measure, x, y, prediction } = this.state
            
            async function apprendice(){
                for (var i = 0; i < 1; i++){
                    theindata["data"] = [i,i+1,i+2,i+3,i+4,i+5,i+6]
                }

            }
            apprendice()
            console.log("connn ", theindata)
            thelabels = {labels: { labels:["app","app","app","app","app","app"]
            
            }
           

            
        }
            //console.log(theindata)
            //there shoud be sliders accepting params
            //there should  be popovers informational of whats going on
            return (

            <div>
             <Grid container>
             <Grid item xs={3}>
                 <Card>
                 <CardHeader
        
                    title="Is TensorFlow Ready?"
                        />
                        
                     <CardContent>
                        {this.state.isTfReady?<p>Yes Ready</p>:<p>Not Ready</p>}
                    </CardContent>
                </Card>
               </Grid> 
               <Grid item xs={3}>
                   <Card>
                   <CardHeader
        
                        title="Is the model Training?"
                            />
                    <CardContent>
                        {this.state.isitraining?<p>Yes Training...</p>:<p>Not Training</p>}
                    </CardContent>
                    </Card>
                </Grid>
                
                <Grid container>
                
                    <Grid item md={12}>
                        <Card>
                            <CardContent>
                            <CardHeader
        
                                title="Prediction Results"
                                    />
                                {this.state.prediction && this.state.trained? <p>{this.state.prediction} </p>: <p>Loading<img src={aPic}></img></p>}
                            </CardContent>
                            </Card>
                    </Grid>
                </Grid>
                </Grid>
                <Grid container>
                <Grid item md={12}>
                    <Card>
                    <CardHeader
        
                        title="Weights from Model"
                            />
                        <CardContent>
                            
                            {this.state.trained?<p>{this.state.measure1}</p>:<p>Loading<img src={aPic}></img></p>}
                        </CardContent>
                    </Card>
                </Grid>

                </Grid>
                <Grid container>
                    <Grid item md={12}>
                        <Card>
                        <CardHeader
            
                            title="eval"
                                />
                            <CardContent>
                                {this.state.trained?<p>{this.state.measure}</p>:<p>Loading<img src={aPic}></img></p>}
                                {theindata?<div><LineGraph data={theindata.data} /></div>:<p>Nothing to show</p>}
                            </CardContent>
                        </Card>
                    </Grid>

                </Grid>
                
            </div>
            );
        }
    
}
